import { Link,Switch, Route } from "react-router-dom";
import About from "./About";
import Contact from "./Contact";
import Dash from "./Dash";
import Footer from "./Footer";
import Header from "./Header";
import NotFound from "./NotFound";

import { useEffect, useState } from "react";
import { useHistory } from 'react-router-dom';
import Signup from "./Signup";
import Profile from "./Profile";
import Login from "./Login";
import Admin from "./Admin.js";
import Customer from "./Customer";
import Track from "./Track";
import Add from "./Add";
import Edit from "./Edit";
import EmpList from "./EmpList";
import AddEmp from "./AddEmp";
import EditEmp from "./EditEmp";
import DeliveryBoy from "./DeliveryBoy";


function  Launch()
{

      const [username, setUserName] = useState("User");
            const history = useHistory(); 

          const {SignIn,SignOut}=Auth();

          useEffect(()=>{
            if(sessionStorage.getItem("username")!=null)
            {
                  setUserName(sessionStorage.getItem("username"));
            }
            else
            {
                  setUserName("User");
            }
         },[]);






         const ShowButton =()=>{

            // if(1)
            // {
            //       return  <button className='btn btn-warning' onClick={SignIn}>Log In</button>
            // }
            // else
            // {
            //       return  <button className='btn btn-warning' onClick={{SignOut}}>Log out</button>
            // }
         }  
    return (<> 
                <Header></Header>



                 <div className="nav">

                 <div style={{paddingLeft:50}}>
                  Welcome {" "} {username}

                   {/* {ShowButton()}  */}


                 </div>

                 {"   |   "}
                 <Link to="/about">About Us</Link>
                 {"   |   "}    
                 <Link to="/contact">Contact Us</Link>
                 {"   |   "}   
                 <Link to="/signup">Signup</Link>
                 {"   |   "}   
                 <Link to="/profile">Profile</Link>
                 </div>
               <Switch>
                   <Route path="/db"
                        component={Dash} />
                         <Route path="/about" 
                                exact
                               component={About}/>
                         <Route path="/contact" 
                                exact
                               component={Contact}/>
                        <Route path="/signup" 
                               exact
                               component={Signup}/>
                                <Route path="/admin" 
                               exact
                               component={Admin}/>
                                 <Route path="/customer" 
                               exact
                               component={Customer}/>
                                <Route path="/track" 
                               exact
                               component={Track}/>
                                <Route path="/add" 
                               exact
                               component={Add}/>
                                <Route path="/Edit" 
                               exact
                               component={Edit}/>
                                <Route path="/EmpList" 
                               exact
                               component={EmpList}/>
                                 <Route path="/addEmp" 
                               exact
                               component={AddEmp}/>
                                <Route path="/EditEmp" 
                               exact
                               component={EditEmp}/>
                                 <Route path="/deliveryboy" 
                               exact
                               component={DeliveryBoy}/>
                         <Route path="/profile" 
                               exact
                               component={Profile}/>

                        <Route path="/"
                        component={Login} />


                         <Route path="*" 
                               component={NotFound}/>
                   </Switch>

                <Footer></Footer>
            </>);
}

export default Launch;
